import React from 'react';

import $ from "jquery";

import "./fullheader.css"

export default class fullheader extends React.Component {


	constructor(props) {
		super(props);
	}
	componentDidMount(){
		$(document).ready(function(){
		  $(".customSpan").click(function(){
		  	 $(".overlay1").css("width", "100%");


		  });
		  $(".closebtn1").click(function(){
		  	 $(".overlay1").css("width", "0%");

		  });
		});

	};

	render() {
		return (
			<div className="col-lg-12" >
				 <div id="myNav" className="overlay1 col-lg-4">
				  <a href="javascript:void(0)" className="closebtn1">&times;</a>
				  <div className="overlay-content1 col-lg-4">
				    <a href="#">About</a>
				    <a href="#">Services</a>
				    <a href="#">Clients</a>
				    <a href="#">Contact</a>
				  </div>
				</div>

				<span className="customSpan" >&#9776; open</span>
			</div>
		);
	}
}
